import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import Homepage from "./components/HomePage/Homepage";
import AddItem from "./components/AddPostPage/AddItem";
import Login from "./components/LoginPage/Login";
import Signup from "./components/SignupPage/Signup";
import { Route, Routes, BrowserRouter, Navigate } from "react-router-dom";
import reportWebVitals from "./reportWebVitals";
import Navbar from "./components/Navbar/Navbar";
import Profile from "./components/ProfilePage/Profile";
import Messages from "./components/MessagePage/Messages";
import Inbox from "./components/InboxPage/Inbox";
import AdminProfile from "./components/AdminProfile/AdminProfile";
import PrivateRoute from './PrivateRoute';

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/addItem" element={<PrivateRoute><AddItem /></PrivateRoute>} />
        <Route path="/home" element={<PrivateRoute><Homepage /></PrivateRoute>} />
        <Route path="/navbar" element={<PrivateRoute><Navbar /></PrivateRoute>} />
        <Route path="/profile" element={<PrivateRoute><Profile /></PrivateRoute>} />
        <Route path="/messages" element={<PrivateRoute><Messages /></PrivateRoute>} />
        <Route path="/inbox" element={<PrivateRoute><Inbox /></PrivateRoute>} />
        <Route path="/admin" element={<PrivateRoute><AdminProfile /></PrivateRoute>} />
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);

reportWebVitals();
